import React, { useEffect, useState } from 'react'
import "./cart.css"
export default function Cart({cart}) {

    
  
  return (
    <div className="cart">
        {cart.map((item, index) => {
            return <div className='cart-item' key={index}>
                   
                <span>{item.name}</span>
                <span>{item.price}</span>
            </div>
        })}
    </div>
  )
}
